import './modal.css'
import {FiX, FiClipboard} from 'react-icons/fi'

export default function ModalLink(){
	return(

		<div className="containerModal">
			<div className="headerModal">
				<h2>Link Encurtado</h2>
				<button><FiX size={28} color="#000"/></button>
			</div>
		</div>

	)
}
